Tool args: {'content': "-- Initial Schema Migration for HOMEase | AI

-- Create custom ENUM types for status fields to ensure data consistency.
CREATE TYPE public.user_role AS ENUM ('homeowner', 'contractor', 'admin');
CREATE TYPE public.project_status AS ENUM ('pending_assessment', 'pending_proposals', 'in_progress', 'completed', 'cancelled');
CREATE TYPE public.proposal_status AS ENUM ('submitted', 'accepted', 'rejected', 'archived');
CREATE TYPE public.contract_status AS ENUM ('pending_signature', 'active', 'completed', 'terminated');
CREATE TYPE public.milestone_status AS ENUM ('pending', 'in_progress', 'awaiting_approval', 'approved', 'paid');
CREATE TYPE public.payment_status AS ENUM ('pending', 'succeeded', 'failed');
CREATE TYPE public.review_status AS ENUM ('pending', 'published', 'archived');
CREATE TYPE public.notification_type AS ENUM ('new_proposal', 'proposal_accepted', 'message_received', 'milestone_update', 'payment_processed');

-- 1. Profiles Table
-- Stores public user information and links to Supabase Auth.
CREATE TABLE public.profiles (
    id UUID PRIMARY KEY REFERENCES auth.users ON DELETE CASCADE,
    full_name TEXT,
    avatar_url TEXT,
    user_type user_role NOT NULL,
    created_at TIMESTAMPTZ NOT NULL DEFAULT now(),
    updated_at TIMESTAMPTZ NOT NULL DEFAULT now()
);
COMMENT ON TABLE public.profiles IS 'Stores public user information, linked to the auth.users table.';
ALTER TABLE public.profiles ENABLE ROW LEVEL SECURITY;

-- 2. Homeowners Table
-- Stores specific details for users with the 'homeowner' role.
CREATE TABLE public.homeowners (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    profile_id UUID NOT NULL REFERENCES public.profiles ON DELETE CASCADE,
    address TEXT,
    city TEXT,
    state TEXT,
    zip_code TEXT
);
COMMENT ON TABLE public.homeowners IS 'Contains homeowner-specific profile information.';
ALTER TABLE public.homeowners ENABLE ROW LEVEL SECURITY;

-- 3. Contractors Table
-- Stores specific details for users with the 'contractor' role.
CREATE TABLE public.contractors (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    profile_id UUID NOT NULL REFERENCES public.profiles ON DELETE CASCADE,
    company_name TEXT,
    license_number TEXT,
    years_experience INT,
    service_area JSONB,
    description TEXT,
    profile_picture_url TEXT,
    average_rating NUMERIC(3, 2) DEFAULT 0.00
);
COMMENT ON TABLE public.contractors IS 'Contains contractor-specific profile information and aggregates.';
ALTER TABLE public.contractors ENABLE ROW LEVEL SECURITY;

-- 4. Specialties Table
-- Stores a list of contractor specialties (e.g., Plumbing, Electrical).
CREATE TABLE public.specialties (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    name TEXT NOT NULL UNIQUE
);
COMMENT ON TABLE public.specialties IS 'Defines the different types of contractor specialties.';

-- 5. Contractor Specialties (Join Table)
-- Links contractors to their specialties.
CREATE TABLE public.contractor_specialties (
    contractor_id UUID NOT NULL REFERENCES public.contractors ON DELETE CASCADE,
    specialty_id UUID NOT NULL REFERENCES public.specialties ON DELETE CASCADE,
    PRIMARY KEY (contractor_id, specialty_id)
);
COMMENT ON TABLE public.contractor_specialties IS 'Many-to-many relationship between contractors and their specialties.';

-- 6. Portfolio Items Table
-- Stores portfolio items for contractors.
CREATE TABLE public.portfolio_items (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    contractor_id UUID NOT NULL REFERENCES public.contractors ON DELETE CASCADE,
    project_name TEXT,
    description TEXT,
    image_urls JSONB,
    video_url TEXT,
    completed_date DATE
);
COMMENT ON TABLE public.portfolio_items IS 'Showcases a contractor''s past work.';
ALTER TABLE public.portfolio_items ENABLE ROW LEVEL SECURITY;

-- 7. Projects Table
-- The core table for renovation projects.
CREATE TABLE public.projects (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    homeowner_id UUID NOT NULL REFERENCES public.homeowners ON DELETE CASCADE,
    title TEXT NOT NULL,
    description TEXT,
    location_address TEXT,
    status project_status NOT NULL DEFAULT 'pending_assessment',
    estimated_budget NUMERIC(12, 2),
    estimated_start_date DATE,
    estimated_end_date DATE,
    created_at TIMESTAMPTZ NOT NULL DEFAULT now(),
    updated_at TIMESTAMPTZ NOT NULL DEFAULT now()
);
COMMENT ON TABLE public.projects IS 'Represents a home renovation project initiated by a homeowner.';
ALTER TABLE public.projects ENABLE ROW LEVEL SECURITY;

-- 8. Project Assessments Table
-- Stores data from the AR assessment.
CREATE TABLE public.project_assessments (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    project_id UUID NOT NULL REFERENCES public.projects ON DELETE CASCADE,
    ar_raw_data JSONB,
    visualizations_url TEXT,
    material_choices JSONB,
    preliminary_cost_estimate NUMERIC(12, 2),
    preliminary_timeline JSONB,
    generated_at TIMESTAMPTZ NOT NULL DEFAULT now()
);
COMMENT ON TABLE public.project_assessments IS 'Stores the output from the initial AR assessment.';
ALTER TABLE public.project_assessments ENABLE ROW LEVEL SECURITY;

-- 9. Proposals Table
-- Stores proposals submitted by contractors for projects.
CREATE TABLE public.proposals (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    project_id UUID NOT NULL REFERENCES public.projects ON DELETE CASCADE,
    contractor_id UUID NOT NULL REFERENCES public.contractors ON DELETE CASCADE,
    proposal_details JSONB,
    proposed_cost NUMERIC(12, 2) NOT NULL,
    proposed_timeline JSONB,
    submitted_at TIMESTAMPTZ NOT NULL DEFAULT now(),
    status proposal_status NOT NULL DEFAULT 'submitted'
);
COMMENT ON TABLE public.proposals IS 'Contractor bids submitted for a specific project.';
ALTER TABLE public.proposals ENABLE ROW LEVEL SECURITY;

-- 10. Contracts Table
-- Stores the final agreement between homeowner and contractor.
CREATE TABLE public.contracts (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    project_id UUID NOT NULL REFERENCES public.projects ON DELETE CASCADE,
    contractor_id UUID NOT NULL REFERENCES public.contractors ON DELETE CASCADE,
    homeowner_id UUID NOT NULL REFERENCES public.homeowners ON DELETE CASCADE,
    proposal_id UUID REFERENCES public.proposals ON DELETE SET NULL, -- A contract originates from a proposal
    contract_text_url TEXT, -- Link to a PDF in Supabase Storage
    signed_homeowner_at TIMESTAMPTZ,
    signed_contractor_at TIMESTAMPTZ,
    status contract_status NOT NULL DEFAULT 'pending_signature',
    total_agreed_cost NUMERIC(12, 2) NOT NULL,
    initial_deposit_percentage NUMERIC(5, 2)
);
COMMENT ON TABLE public.contracts IS 'The formal, signed agreement for a project.';
ALTER TABLE public.contracts ENABLE ROW LEVEL SECURITY;

-- 11. Milestones Table
-- Tracks project milestones and associated payments.
CREATE TABLE public.milestones (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    project_id UUID NOT NULL REFERENCES public.projects ON DELETE CASCADE,
    contract_id UUID NOT NULL REFERENCES public.contracts ON DELETE CASCADE,
    name TEXT NOT NULL,
    description TEXT,
    due_date DATE,
    cost_percentage NUMERIC(5, 2) NOT NULL,
    status milestone_status NOT NULL DEFAULT 'pending',
    contractor_confirmed_at TIMESTAMPTZ,
    homeowner_confirmed_at TIMESTAMPTZ
);
COMMENT ON TABLE public.milestones IS 'Defines the stages and payment schedule of a contract.';
ALTER TABLE public.milestones ENABLE ROW LEVEL SECURITY;

-- 12. Payments Table
-- Records all financial transactions.
CREATE TABLE public.payments (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    project_id UUID NOT NULL REFERENCES public.projects ON DELETE CASCADE,
    milestone_id UUID REFERENCES public.milestones ON DELETE SET NULL,
    contract_id UUID NOT NULL REFERENCES public.contracts ON DELETE CASCADE,
    payer_profile_id UUID NOT NULL REFERENCES public.profiles ON DELETE CASCADE,
    payee_profile_id UUID NOT NULL REFERENCES public.profiles ON DELETE CASCADE,
    amount NUMERIC(12, 2) NOT NULL,
    currency VARCHAR(3) NOT NULL DEFAULT 'USD',
    transaction_id TEXT, -- From external payment gateway
    status payment_status NOT NULL DEFAULT 'pending',
    processed_at TIMESTAMPTZ
);
COMMENT ON TABLE public.payments IS 'Logs all financial transactions related to milestones and contracts.';
ALTER TABLE public.payments ENABLE ROW LEVEL SECURITY;

-- 13. Messages Table
-- Enables in-platform communication.
CREATE TABLE public.messages (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    project_id UUID NOT NULL REFERENCES public.projects ON DELETE CASCADE,
    sender_profile_id UUID NOT NULL REFERENCES public.profiles ON DELETE CASCADE,
    receiver_profile_id UUID NOT NULL REFERENCES public.profiles ON DELETE CASCADE,
    message_text TEXT NOT NULL,
    sent_at TIMESTAMPTZ NOT NULL DEFAULT now(),
    read_at TIMESTAMPTZ,
    attachment_url TEXT -- Link to file in Supabase Storage
);
COMMENT ON TABLE public.messages IS 'Stores communication threads between users for a project.';
ALTER TABLE public.messages ENABLE ROW LEVEL SECURITY;

-- 14. Reviews Table
-- Stores reviews of contractors by homeowners.
CREATE TABLE public.reviews (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    project_id UUID NOT NULL REFERENCES public.projects ON DELETE CASCADE,
    homeowner_id UUID NOT NULL REFERENCES public.homeowners ON DELETE CASCADE,
    contractor_id UUID NOT NULL REFERENCES public.contractors ON DELETE CASCADE,
    rating NUMERIC(3, 2) NOT NULL,
    comment TEXT,
    submitted_at TIMESTAMPTZ NOT NULL DEFAULT now(),
    status review_status NOT NULL DEFAULT 'pending'
);
COMMENT ON TABLE public.reviews IS 'Feedback provided by homeowners for completed projects.';
ALTER TABLE public.reviews ENABLE ROW LEVEL SECURITY;

-- 15. Notifications Table
-- Stores notifications for users.
CREATE TABLE public.notifications (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    profile_id UUID NOT NULL REFERENCES public.profiles ON DELETE CASCADE,
    type notification_type NOT NULL,
    message TEXT NOT NULL,
    read BOOLEAN NOT NULL DEFAULT FALSE,
    created_at TIMESTAMPTZ NOT NULL DEFAULT now(),
    related_entity_id UUID,
    related_entity_type TEXT
);
COMMENT ON TABLE public.notifications IS 'User-facing notifications for platform events.';
ALTER TABLE public.notifications ENABLE ROW LEVEL SECURITY;

-- 16. Admin Logs Table
-- For auditing administrator actions.
CREATE TABLE public.admin_logs (
    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
    admin_profile_id UUID NOT NULL REFERENCES public.profiles ON DELETE CASCADE,
    action TEXT NOT NULL,
    details JSONB,
    target_entity_type TEXT,
    target_entity_id UUID,
    timestamp TIMESTAMPTZ NOT NULL DEFAULT now()
);
COMMENT ON TABLE public.admin_logs IS 'Audit trail for actions performed by platform administrators.';
ALTER TABLE public.admin_logs ENABLE ROW LEVEL SECURITY;

-- Function to create a profile for a new user
CREATE OR REPLACE FUNCTION public.handle_new_user()
RETURNS TRIGGER
LANGUAGE plpgsql
SECURITY DEFINER
AS $$
BEGIN
  INSERT INTO public.profiles (id, user_type)
  VALUES (new.id, 'homeowner'); -- Default new users to 'homeowner'
