import { createRouteHandlerClient } from '@supabase/auth-helpers-nextjs';
import { cookies } from 'next/headers';
import { NextResponse } from 'next/server';

export const dynamic = 'force-dynamic';

export async function POST(request: Request) {
  const { email, password, fullName, userType } = await request.json();
  const supabase = createRouteHandlerClient({ cookies });

  // Sign up the user
  const { data: { user }, error: signUpError } = await supabase.auth.signUp({
    email,
    password,
    options: {
      emailRedirectTo: `${new URL(request.url).origin}/auth/callback`,
    },
  });

  if (signUpError || !user) {
    return NextResponse.json({ error: signUpError?.message || 'Could not sign up user.' }, { status: 400 });
  }

  // Create a profile for the new user
  const { error: profileError } = await supabase
    .from('profiles')
    .insert({
      id: user.id,
      full_name: fullName,
      user_type: userType, // 'homeowner' or 'contractor'
    });

  if (profileError) {
    // If profile creation fails, it's good practice to also delete the user
    // to avoid orphaned auth users.
    await supabase.auth.admin.deleteUser(user.id);
    return NextResponse.json({ error: profileError.message || 'Could not create user profile.' }, { status: 500 });
  }

